svg.desc:
# Generated by go/gcpdraw
meta {
  title "Automatic deletion of Compute Engine instances at scale"
}

elements {
  gcp {
    card scheduler
    card pubsub
    card gcf

    group project {
      group zone_1 {
        name "Zone 1"
        stacked_card gce as gce1
      }
      group zone_2 {
        name "Zone 2"
        stacked_card gce as gce2
      }
    }
  }
}

paths {
  scheduler -down-> pubsub
  pubsub -down-> gcf
  gcf --> gce1
  gcf --> gce2
}
